import './Sidemenu.scss';

function Sidemenu(props){
    console.log(props);
    return(
        <ul className="list">
            <li key="about" onClick={props.clickHandler.bind(this, "about")}>About me</li>
            <li key="tech" onClick={props.clickHandler.bind(this, "tech")}>Technologies and Curriculum</li>
            <li key="projects" onClick={props.clickHandler.bind(this, "projects")}>Projects</li>
            <li key="contact">Contact</li>
        </ul>
    )
}

export default Sidemenu;
